class Env {
	#envData;

	constructor() {
	    this.#envData = {};
	}

	init(callback) {
	    if (process.env.NODE_ENV === 'development') {
	        this.#envData = {
	            SERVER_URL_TRUST_LINK: process.env.VUE_APP_SERVER_URL_TRUST_LINK,
	            AP_NAME: process.env.VUE_APP_AP_NAME,
	            MENU_COLLAPSE: process.env.VUE_APP_MENU_COLLAPSE,
	            API_URL: process.env.VUE_APP_API_URL,
	            API_TIMEOUT: process.env.VUE_APP_API_TIMEOUT
	        };
	        callback.call(this);
	    } else {
	        let _this = this;
	        axios.get('/' + process.env.VUE_APP_AP_NAME + '/getEnv')
	        .then(function(response) {
	            _this.#envData = response.data;
	            callback.call(this);
	        });
	    }
	}

	getData() {
	    return this.#envData;
	}
}

export default Env;
